import UIKit

//https://leetcode-cn.com/problems/is-subsequence/

// 56
// 把s转成队列，依次出站
// 在t中找出站的字符，截取新的子字符串，直到队列出站完毕
class Solution {
    func isSubsequence(_ s: String, _ t: String) -> Bool {
        var queue = Array(s)// 转成字符串数据
        var subString = t
        while !queue.isEmpty {
            // 移除第一个字符
            let char = queue.removeFirst()
            // 找到第一个字符在t中的位置
            if let index = subString.firstIndex(of: char) {
                // 截取这个字符后面的所有字符串
                // 因为queue改变了，会出发下次遍历
                let newIndex = subString.index(index, offsetBy: 1)
                subString =  String(subString[newIndex...])
            }else {
                return false
            }
        }
        return queue.isEmpty
    }
    
}

